import React from 'react';

function HomePage() {
  return (
    <div>
      <header>
        <h1>Welcome to My React Home Page</h1>
      </header>
      <main>
        <p>This is a simple example of a React home page.</p>
        <p>You can customize it further by adding more components and functionality.</p>
      </main>
      <footer>
        <p>&copy; 2024 My React Home Page. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default HomePage;
